import React from "react";
import './ChanteuseComponent.css';
import Footer from '../Footer/Footer';
import { Link } from "react-router-dom";
import { MDBCard, MDBCardBody, MDBCol, MDBRow, MDBContainer, MDBCardTitle, MDBCardText } from "mdbreact";
import InfiniteCarousel from 'react-leaf-carousel';
import margotCoachingImg from '../img/MargotCoaching.jpg';

const ChanteuseComponent = () => {
return (
  <div className="ChanteuseComponent">



  <InfiniteCarousel
    breakpoints={[
      {
        breakpoint: 500,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 2,
        },
      },
      {
        breakpoint: 768,
        settings: {
          slidesToShow: 3,
          slidesToScroll: 3,
        },
      },
    ]}
    dots={true}
    showSides={true}
    sidesOpacity={.5}
    sideSize={.1}
    slidesToScroll={4}
    slidesToShow={4}
    scrollOnDevice={true}
  >
    <div>
      <img
        alt=''
        src={margotCoachingImg}
      />
    </div>

  </InfiniteCarousel>
    </div>
  )
};

export default ChanteuseComponent;
